import { gql } from "@apollo/client";

export const QUERY_USERS = gql`
  query allUsers {
      users {
        id
        username
        image
      }
    }
`;

export const QUERY_ = gql`
  query allUsers {
      users {
        id
        username
        image
      }
    }
`;
